            <div class = "popup-container">

            <div class = "popup-inner">

<div class = "container">
    TRY
</div>

<button class = "closeButton" onClick={() => props.setTrigger(false)}>
    close
</button>

</div>

            </div>
            

        </div>

    ) : "";
}

export default Popup;
